'Debugging can be used for troubleshooting. If you turn it on, the system will log every action to your History log. You can use these messages to investigate the flow of commands, and to find out what is wrong. This way you can check what are the scripts doing and where exactly they fail. In production it should be turned off, because it generates multiple history records for each transaction and slows down the system.'=>'Debugowanie może zostać wykorzystane do rozwiązywania problemów. Jeżeli go włączysz, system zapisze logi każdego działania w dzienniku historii. Możesz używać wiadomości do zbadania przepływu poleceń oraz wykrycia błędów. W ten sposób możesz sprawdzić, które skrypty są wykonywane oraz gdzie dokładnie występują błędy. Tryb ten należy włączać jedynie w trakcie testów, ponieważ generuje ogromną ilość zapisów dla każdego zdarzenia co znacznie spowalnia system.',
