'Action commissions'=>'Prowizje za działania (Action commissions)',
'Action Commissions feature allows you to define per action, or per "anything" commissions.<br/>This way you can define commissions for example per user registration, per download, per visiting specific page, etc.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Funkcja/feature Prowizje za działania (Action commissions) pozwalaja zdefiniować prowizje za wszystkie podjęte przez Klienta działania np.: rejestrację, pobranie, członkostwo, odwiedziny określonej www itp. <br/><a href="%s" target="_blank">Więcej informacji znajdziesz w naszej Bazie Wiedzy</a>',
'More help in our Knowledge Base'=>'Więcej informacji znajdziesz w naszej Bazie Wiedzy',
'Banner rotator is a special type of banner that rotates other banners.<br/>When affiliate inserts rotator to his page, the rotator displays banners that are assigned to the rotator, so the visitor will see another banner every time he visits the affiliates page.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Rotacja banerów (Banner rotator) jest specjalnym typem banera, umożliwiającym wyświetlanie różnych banerów na stronach Partnerów. </br> Kiedy Partner doda właściwości rotacji do swojej strony, zostaną wyświetlane wszystkie banery do niej przypisane. Zatem użytkownik odwiedzający witrynę Partnera za każdym razem zobaczy inny baner. <br/><a href="%s" target="_blank">Więcej informacji i pomoc w naszej Bazie Wiedzy</a>',
'Branding free'=>'Własna marka (Branding free)',
'Branding Free is a special feature that allows you to change the links in the footer of panels and signup form from "Powered by %s" to your own text and link.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Własna marka (Branding free) jest specjalną funkcją/feature pozwalającą na zmianę linków w stopce paneli i formularzu rejestracyjnym z "Powered by% s" do własnego tekstu i linków. <br/><a href="%s" target="_blank">Więcej informacji znajdziesz w naszej Bazie Wiedzy</a>',
'Commission Groups'=>'Prowizja Grupowa (Commission Groups)',
'Commission groups allow you to set different commissions for different users for the same campaign.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Prowizja Grupowa (Commission Groups) jest specjalną funkcją/feature pozwalającą na ustawienie różnych prowizji dla różnych użytkowników dla tej samej kampanii. <br/><a href="%s" target="_blank"> Więcej informacji znajdziesz w naszej Bazie Wiedzy</a>',
'CPM commissions'=>'Prowizje CPM (CPM commissions)',
'CPM (cost per mille) commissions are a special type of commissions that are rewarded for 1000 impressions, which means for displaying your banners 1000 times.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Prowizje CPM (CPM commissions) (koszt tysiąca wyświetleń) są szczególnym rodzajem prowizji nagradzającym Partnerów za 1 000 wyświetleń Twojego banera. <br/><a href="%s" target="_blank"> Więcej informacji znajdziesz w naszej Bazie Wiedzy</a>',
'Forced matrix allows you to limit to the number of referrals of subaffiliates any affiliate can refer. It means that every affiliate can have only specified number of children. <a href="%s" target="_blank">More details read in our Knowledge Base</a>'=>'Ograniczona Struktura (Forced matrix) pozwala na ograniczenie w głąb i wszerz liczby poziomów PodPartnerów dla danego Partnera, czyli ustalenie limitów poleceń Partnera. Oznacza to, że każdy zarejestrowany Partner, może mieć jedynie określoną liczbę PodPartnerów. <a href="%s" target="_blank">Więcej informacji znajdziesz w naszej Bazie Wiedzy</a>',
'Hosting of %s on  %s servers.'=>'Hosting %s na  %s serwerach.',
'Multiple currencies allow you to track sales in multiple currencies.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Wielowalutowość (Multiple currencies) jest specjalną funkcją/feature umożliwiającą śledzenie sprzedaży w różnych walutach. <br/><a href="%s" target="_blank">Więcej informacji w naszej Bazie Wiedzy</a>',
'Multiple merchants'=>'Wielu administratorów (Multiple merchants)',
'By default, all campaigns in %s are public, which means that all affiliates can view and promote them. Private campaigns feature allows you to create private campaigns, which will be visible only to selected affiliates.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Domyślnie, statut wszystkich kampanii w %s ustawiony jest jako publiczny, co oznacza możliwość przeglądania i promowania ich przez wszystkich Partnerów. Funkcja/features Prywatne Kampanie (Private campaigns) pozwala na stworzenie kampanii widocznych tylko dla wybranych Partnerów.<br/><a href="%s" target="_blank">Więcej informacji znajdziesz w naszej Bazie Wiedzy</a>',
'It alows you to create a special type of promo materials - rebrandable e-books. You can create your PDF e-book only once and upload it to %s.Your affiliates will automatically get their own re-branded copy of the book, with their name, affiliate links, texts, etc. There is no need to run any Windows program for branding, they will simply download rebranded PDF. All the rebranding is made automatically in the background.<br/><a href="%s" target="_blank">%s</a>'=>'Ta funkcja/feature umożliwia stworzenie specjalnych materiałów promocyjnych, zwanych Przemianowanymi E-books (Rebrandable E-books). W celu promocji wystarczy, że tylko raz stworzysz e-book oraz prześlesz go do %s. Dzięki temu, Twoi Partnerzy automatycznie otrzymają jego kopię uwzględniającą ich własne nazwy, linki partnerskie oraz teksty. Funkcja/feature Przemianowany E-Books (Rebrandable E-books) pozwala zaoszczędzić, zarówno Tobie jak również Partnerom czas i pieniądze, ponieważ od tej pory nikt, już nie będzie musiał kupować oraz ściągać dodatkowych programów pozwalających promować markę. Wszystko co należy zrobić, to pobrać tylko przemianowane PDF. Cały proces przeróbki jest w pełni automatyczny i odbywa się w tle. <br/><a href="%s" target="_blank">%s</a>',
'Recurring commissions allow you to reward your affiliates for recurring payments, for example for hosting or membership. <br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Odnawialne prowizje (Recurring commission) pozwalają przyznawać nagrody Twoim Partnerom za powtarzające się płatności, czego przykładem może być hosting lub członkostwo. <br/><a href="%s" target="_blank">Więcej informacji znajdziesz w naszej Bazie Wiedzy</a>',
