'Auto approval of commissions plugin require cron job which is not running now. Please set it up in Tools -> Integration -> Cron Job Integration'=>'Wtyczka/plugin Automatyczne zatwierdzanie prowizji (Automatic approval of commissions) wymaga aktywnego Cron\'a, który obecnie nie jest uruchomiony. Proszę włączyć go w Narzędzia->Integracja->Integracja Cron',
