'Plugin will add to menu Tools new item "Database status", under which you can view database tables of %s. Information about database tables includes e.g. table names, table size, number of rows in each table. You can execute on tables database operations like Analyze table, Optimize table or Repair table. After activation of this plugin you need to reload application in browser to see changes in menu!'=>'Ta wtyczka/plugin doda do menu Narzędzia nowy element "Status bazy danych", służący do wyświetlania tabel z bazy danych %s. Przykładowe informacje o tabelach obejmują nazwy tabel, rozmiar tabel, liczbę wierszy w każdej tabeli. Dzięki temu można wykonywać na nich określone operacje, takie jak: analizuj, optymalizuj lub napraw. Po aktywacji wtyczki/pluginu należy odświeżyć aplikację w przeglądarce, w celu dodania zmiany w menu!',
'Plugin is possible to activate only in case database user used for connecting to database of %s has rights to read from system table INFORMATION_SCHEMA.TABLES.'=>'Wtyczka/plugin służy do podłączenia sie do bazy danych % i może być aktywowana tylko dla użytkowników baz danych mających prawa do odczytu z tablicy systemowej INFORMATION_SCHEMA.TABLES.',
